import React from "react";
import './styles.css';

const About=()=>{
    return (
        <div class="about-me-section">
            <div class="about-me-content">
            <h1 className="about-header">Who I Am</h1>
            <p className="about-bio">I am currently a senior at Boston University and majoring in Computer Science.</p>
            <a href="/path/to/resume.pdf" class="download-button" download>Download Résumé</a>
            </div>
            <div class="photo-gallery">
            <div class="gallery-item"><img src="/path/to/image1.jpg" alt="Gallery Image 1"/></div>
            <div class="gallery-item"><img src="/path/to/image2.jpg" alt="Gallery Image 2"/></div>
            <div class="gallery-item"><img src="/path/to/image3.jpg" alt="Gallery Image 3"/></div>
            </div>
        </div>
    )
}

export default About;
